import React, { Component, MouseEvent } from 'react';

export default class LoginButton extends Component {
  /**@param {MouseEvent} e*/
  onClick(e) {
    this.props.submit();
  }
  
  render() {
    return (
      <button className="login-button" onClick={this.onClick.bind(this)}>
          {this.props.value || this.props.children}
      </button>
    );
  }
}
